import { View, Text, TouchableOpacity } from 'react-native'
import React, { useState }from 'react'
import HeaderTabs from './HeaderTabs'

export default function home() {
  const [ activeTab, setActiveTab ] = useState("Delivery")

  return (
    <View style = {{flexDirection: "row", alignSelf: "center"}}>
      <HeaderButton Text = "Delivery" btnColor = "teal" textColor = "white" activeTab = {activeTab}/>
      <HeaderButton Text = "Pickup" btnColor = "white" textColor = "teal"/>
    </View>
  )
}

const HeaderButton = (props) => (
  <TouchableOpacity style = {{
    backgroundColor: props.btnColor,
    paddingVertical: 6,
    paddingHorizontal: 16,
    borderRadius: 30,
    marginTop: 15,
    marginLeft: 5
  }}>
    <Text style = {{color: props.textColor, fontSize: 15, fontWeight: "600"}}>{props.Text}</Text>
  </TouchableOpacity>
)
